    #temp table of members and conditions: cedargate version
    def temp_conditions_cg(self, schema, svc_year='2024'):
        
        q = f"""
            -- Finding members by the 'two days of service' rule
            DROP TABLE IF EXISTS #TWO_DAY_RULE;
            WITH
                dx1 AS (
                    SELECT dw_member_id, svc_service_frm_date, replace(svc_diag_1_code, '.', '') as dx, DJ.*
                    FROM {schema}.medical AC
                    INNER JOIN #disease_joiner DJ ON replace(svc_diag_1_code, '.', '') = replace(cd_sys_concept_cd, '.', '') AND
                                                    date_part('year', svc_service_frm_date) IN (year, year - 1)
                ),

                dx2 AS (
                    SELECT dw_member_id, svc_service_frm_date, replace(svc_diag_2_code, '.', '') as dx, DJ.*
                    FROM {schema}.medical AC
                    INNER JOIN #disease_joiner DJ ON replace(svc_diag_2_code, '.', '') = replace(cd_sys_concept_cd, '.', '') AND
                                                    date_part('year', svc_service_frm_date) IN (year, year - 1)
                ),

                dx3 AS (
                    SELECT dw_member_id, svc_service_frm_date, replace(svc_diag_3_code, '.', '') as dx, DJ.*
                    FROM {schema}.medical AC
                    INNER JOIN #disease_joiner DJ ON replace(svc_diag_3_code, '.', '') = replace(cd_sys_concept_cd, '.', '') AND
                                                    date_part('year', svc_service_frm_date) IN (year, year - 1)
                ),

                dx4 AS (
                    SELECT dw_member_id, svc_service_frm_date, replace(svc_diag_4_code, '.', '') as dx, DJ.*
                    FROM {schema}.medical AC
                    INNER JOIN #disease_joiner DJ ON replace(svc_diag_4_code, '.', '') = replace(cd_sys_concept_cd, '.', '') AND
                                                    date_part('year', svc_service_frm_date) IN (year, year - 1)
                ),

                all_dxs AS (
                    SELECT DISTINCT dw_member_id, year, svc_service_frm_date, dx, condition FROM dx1 UNION DISTINCT
                    SELECT DISTINCT dw_member_id, year, svc_service_frm_date, dx, condition FROM dx2 UNION DISTINCT
                    SELECT DISTINCT dw_member_id, year, svc_service_frm_date, dx, condition FROM dx3 UNION DISTINCT
                    SELECT DISTINCT dw_member_id, year, svc_service_frm_date, dx, condition FROM dx4
                ),

                checked AS (
                    SELECT dw_member_id, year, condition as condition,
                        CASE WHEN COUNT(DISTINCT svc_service_frm_date) > 1
                                THEN 1
                                ELSE 0 END as flag
                    FROM All_dxs AD
                    GROUP BY dw_member_id, year, condition
                )
            SELECT *
            INTO #TWO_DAY_RULE
            FROM checked;

            -- ER Rule
            DROP TABLE IF EXISTS #ER_RULE;
            WITH
                dx1 AS (
                    SELECT dw_member_id, servicedate, replace(primarydiagnosiscode, '.', '') as dx, DJ.*
                    FROM {schema}.utilization AC
                    INNER JOIN #disease_joiner DJ ON replace(primarydiagnosiscode, '.', '') = replace(cd_sys_concept_cd, '.', '') AND
                                                    date_part('year', servicedate) IN (DJ.year, DJ.year - 1)
                    WHERE visittypedesc = 'ER Visits'
                    ),

                checked AS (
                    SELECT dw_member_id, year, condition as condition, CASE WHEN COUNT(DISTINCT servicedate) > 0 THEN 1 ELSE 0 END as flag
                    FROM dx1 AD
                    GROUP BY dw_member_id, year, condition
                )

            SELECT *
            INTO #ER_RULE
            FROM checked;

            -- Admit Rule
            DROP TABLE IF EXISTS #IP_RULE;
            WITH
                dx1 AS (
                    SELECT dw_member_id, servicedate, replace(primarydiagnosiscode, '.', '') as dx, DJ.*
                    FROM {schema}.utilization AC
                    INNER JOIN #disease_joiner DJ ON replace(primarydiagnosiscode, '.', '') = replace(cd_sys_concept_cd, '.', '') AND
                                                    date_part('year', servicedate) IN (DJ.year, DJ.year - 1)
                    WHERE visittypedesc ILIKE '%Admission%'
                    ),

                checked AS (
                    SELECT dw_member_id, year, condition as condition, CASE WHEN COUNT(DISTINCT servicedate) > 0 THEN 1 ELSE 0 END as flag
                    FROM dx1 AD
                    GROUP BY dw_member_id, year, condition
                )

            SELECT *
            INTO #IP_RULE
            FROM checked;

            -- DIAB MED RULE
            DROP TABLE IF EXISTS #DRUG_RULE;
            WITH
                FILTER AS (
                    SELECT * FROM {schema}.pharmacy P
                    INNER JOIN #DRUG_TABLE DJ ON P.svc_ndc_code = DJ.ndc AND
                                                date_part('year', svc_service_frm_date) IN (year, year - 1)
                            )

                    SELECT dw_member_id, year, 'DIABETES_MELLITUS' as condition, CASE WHEN COUNT(DISTINCT svc_service_frm_date) > 3 THEN 1 ELSE 0 END as flag
                    INTO #DRUG_RULE
                    FROM FILTER
                    GROUP BY dw_member_id, year;

            DROP TABLE IF EXISTS #FINAL_tmp;
            WITH
                RULE_MERGE AS (
                    SELECT dw_member_id, year, condition, flag FROM #TWO_DAY_RULE UNION ALL
                    SELECT dw_member_id, year, condition, flag FROM #ER_RULE UNION ALL
                    SELECT dw_member_id, year, condition, flag FROM #IP_RULE UNION ALL
                    SELECT dw_member_id, year, condition, flag FROM #DRUG_RULE
                ),

                ANY_RULE AS (
                    SELECT dw_member_id, year, condition, CASE WHEN SUM(flag) > 0 THEN 1 ELSE 0 END as flag
                    FROM RULE_MERGE
                    GROUP BY dw_member_id, year, condition
                )

            SELECT
                DW_MEMBER_ID as member_id,
                year,
                NVL(MALIGNANT_NEOPLASM, 0) AS MALIGNANT_NEOPLASM,
                NVL(BLOOD_DYSCRASIAS, 0) AS BLOOD_DYSCRASIAS,
                NVL(DIABETES_MELLITUS, 0) AS DIABETES_MELLITUS,
                NVL(SUBSTANCE_DEPENDENCE, 0) AS SUBSTANCE_DEPENDENCE,
                NVL(RHEUMATOID_ARTHRITIS, 0) AS RHEUMATOID_ARTHRITIS,
                NVL(PERIPHERAL_VASCULAR_DISEASE, 0) AS PERIPHERAL_VASCULAR_DISEASE,
                NVL(CARDIOVASCULAR_DISEASE, 0) AS CARDIOVASCULAR_DISEASE,
                NVL(CORONARY_ARTERY_DISEASE, 0) AS CORONARY_ARTERY_DISEASE,
                NVL(OSTEOARTHRITIS, 0) AS OSTEOARTHRITIS,
                NVL(INFLAMMATORY_BOWEL_DISEASE, 0) AS INFLAMMATORY_BOWEL_DISEASE,
                NVL(HYPERTENSION, 0) AS HYPERTENSION,
                NVL(LIVER_DISEASE_ALL, 0) AS LIVER_DISEASE_ALL,
                NVL(IMMUNODEFICIENCY_DISORDERS, 0) AS IMMUNODEFICIENCY_DISORDERS,
                NVL(HEART_FAILURE, 0) AS HEART_FAILURE,
                NVL(ASTHMA, 0) AS ASTHMA,
                NVL(DEPRESSION, 0) AS DEPRESSION,
                NVL(PSYCHOSIS_AFFECTIVE, 0) AS PSYCHOSIS_AFFECTIVE,
                NVL(CKD3TO5_ESRD_DIALYSIS, 0) AS CKD3TO5_ESRD_DIALYSIS,
                NVL(COPD, 0) AS COPD,
                NVL(EATING_DISORDERS, 0) AS EATING_DISORDERS,
                NVL(HYPERLIPIDEMIA, 0) AS HYPERLIPIDEMIA,
                NVL(ATRIAL_FIBRILLATION, 0) AS ATRIAL_FIBRILLATION,
                NVL(OBESITY_MORBID, 0) AS OBESITY_MORBID,
                NVL(CHRONIC_PAIN, 0) AS CHRONIC_PAIN
            INTO #FINAL_tmp
            FROM
                (SELECT dw_member_id, condition, flag, year FROM ANY_RULE)
                    PIVOT (SUM(flag) FOR
                        condition IN ('MALIGNANT_NEOPLASM', 'BLOOD_DYSCRASIAS', 'DIABETES_MELLITUS', 'SUBSTANCE_DEPENDENCE', 'RHEUMATOID_ARTHRITIS', 
                        'PERIPHERAL_VASCULAR_DISEASE', 'CARDIOVASCULAR_DISEASE', 'CORONARY_ARTERY_DISEASE', 'OSTEOARTHRITIS', 'INFLAMMATORY_BOWEL_DISEASE', 
                        'HYPERTENSION', 'LIVER_DISEASE_ALL', 'IMMUNODEFICIENCY_DISORDERS', 'HEART_FAILURE', 'ASTHMA', 'DEPRESSION', 'PSYCHOSIS_AFFECTIVE', 
                        'CKD3TO5_ESRD_DIALYSIS', 'COPD', 'EATING_DISORDERS', 'HYPERLIPIDEMIA', 'ATRIAL_FIBRILLATION', 'OBESITY_MORBID', 'CHRONIC_PAIN')
                    );
        """
        return q
    
    #temp table of members and conditions: marketscan version
    def temp_conditions_ms(self, svc_year='2024'):
        
        q = f"""
            -- Finding members by the 'two days of service' rule
            DROP TABLE IF EXISTS #TWO_DAY_RULE;
            WITH
                dx1 AS (
                    SELECT enrolid, svcdate, dx1 as dx, DJ.*
                    FROM eoc_workarea.all_claims AC
                    INNER JOIN #disease_joiner DJ ON dx1 = replace(cd_sys_concept_cd, '.', '')
                ),

                dx2 AS (
                    SELECT enrolid, svcdate, dx2 as dx, DJ.*
                    FROM eoc_workarea.all_claims AC
                    INNER JOIN #disease_joiner DJ ON dx2 = replace(cd_sys_concept_cd, '.', '')
                ),

                dx3 AS (
                    SELECT enrolid, svcdate, dx3 as dx, DJ.*
                    FROM eoc_workarea.all_claims AC
                    INNER JOIN #disease_joiner DJ ON dx3 = replace(cd_sys_concept_cd, '.', '')
                ),

                dx4 AS (
                    SELECT enrolid, svcdate, dx4 as dx, DJ.*
                    FROM eoc_workarea.all_claims AC
                    INNER JOIN #disease_joiner DJ ON dx4 = replace(cd_sys_concept_cd, '.', '')
                ),

                all_dxs AS (
                    SELECT DISTINCT enrolid, svcdate, dx, condition FROM dx1 UNION DISTINCT
                    SELECT DISTINCT enrolid, svcdate, dx, condition FROM dx2 UNION DISTINCT
                    SELECT DISTINCT enrolid, svcdate, dx, condition FROM dx3 UNION DISTINCT
                    SELECT DISTINCT enrolid, svcdate, dx, condition FROM dx4
                ),

                checked AS (
                    SELECT enrolid, condition as condition, CASE WHEN COUNT(DISTINCT svcdate) > 1 THEN 1 ELSE 0 END as flag
                    FROM All_dxs AD
                    GROUP BY enrolid, condition
                )
            SELECT *
            INTO #TWO_DAY_RULE
            FROM checked;

            -- ER Rule
            DROP TABLE IF EXISTS #ER_RULE;
            WITH
                dx1 AS (
                    SELECT enrolid, svcdate, dx1 as dx, DJ.*
                    FROM eoc_workarea.all_claims AC
                    INNER JOIN #disease_joiner DJ ON dx1 = replace(cd_sys_concept_cd, '.', '')
                    WHERE svcscat IN ('svcscat', '10120', '10220', '10320', '10420', '10520', '12220', '20120', '20220', '21120', 
                                        '21220', '22120', '22320', '30120', '30220', '30320', '30420', '30520', '30620', '31120', 
                                        '31220', '31320', '31420', '31520', '31620')
                ),
                checked AS (
                    SELECT enrolid, condition as condition, CASE WHEN COUNT(DISTINCT svcdate) > 0 THEN 1 ELSE 0 END as flag
                    FROM dx1 AD
                    GROUP BY enrolid, condition
                )
            SELECT *
            INTO #ER_RULE
            FROM checked;

            -- Admit Rule
            DROP TABLE IF EXISTS #IP_RULE;
            WITH
                ay21 AS (
                    SELECT enrolid, admdate, pdx as dx, DJ.*
                    FROM public.ccaei211 AC
                    INNER JOIN #disease_joiner DJ ON pdx = replace(cd_sys_concept_cd, '.', '')
                ),

                ay22 AS (
                    SELECT enrolid, admdate, pdx as dx, DJ.*
                    FROM public.ccaei221 AC
                    INNER JOIN #disease_joiner DJ ON pdx = replace(cd_sys_concept_cd, '.', '')
                ),

                merged AS (
                    SELECT * FROM ay21 UNION ALL SELECT * FROM ay22
                ),

                checked AS (
                    SELECT enrolid, condition as condition, CASE WHEN COUNT(DISTINCT admdate) > 0 THEN 1 ELSE 0 END as flag
                    FROM merged AD
                    GROUP BY enrolid, condition
                )
            SELECT *
            INTO #IP_RULE
            FROM checked;

            -- DIAB MED RULE
            DROP TABLE IF EXISTS #DRUG_RULE;
            WITH
                FILTER AS (
                    SELECT * FROM eoc_workarea.all_drug_claims P
                            INNER JOIN #DRUG_TABLE DJ ON P.ndcnum = DJ.ndc AND
                                date_part('year', svcdate) IN (P.year, P.year - 1)
                            )
                            
                    SELECT enrolid, 'DIABETES_MELLITUS' as condition, CASE WHEN COUNT(DISTINCT svcdate) > 0 THEN 3 ELSE 0 END as flag
                    INTO #DRUG_RULE
                    FROM FILTER
                    GROUP BY enrolid
            ;      
            
            DROP TABLE IF EXISTS #FINAL_tmp;  
            WITH
                RULE_MERGE AS (
                    SELECT enrolid::varchar, condition, flag FROM #TWO_DAY_RULE UNION ALL
                    SELECT enrolid::varchar, condition, flag FROM #ER_RULE UNION ALL
                    SELECT enrolid::varchar, condition, flag FROM #IP_RULE UNION ALL
                    SELECT enrolid::varchar, condition, flag FROM #DRUG_RULE
                ),

                ANY_RULE AS (
                    SELECT enrolid, condition, CASE WHEN SUM(flag) > 0 THEN 1 ELSE 0 END as flag
                    FROM RULE_MERGE
                    GROUP BY enrolid, condition
                )

            SELECT
                enrolid as member_id,
                NVL(MALIGNANT_NEOPLASM, 0) AS MALIGNANT_NEOPLASM,
                NVL(BLOOD_DYSCRASIAS, 0) AS BLOOD_DYSCRASIAS,
                NVL(DIABETES_MELLITUS, 0) AS DIABETES_MELLITUS,
                NVL(SUBSTANCE_DEPENDENCE, 0) AS SUBSTANCE_DEPENDENCE,
                NVL(RHEUMATOID_ARTHRITIS, 0) AS RHEUMATOID_ARTHRITIS,
                NVL(PERIPHERAL_VASCULAR_DISEASE, 0) AS PERIPHERAL_VASCULAR_DISEASE,
                NVL(CARDIOVASCULAR_DISEASE, 0) AS CARDIOVASCULAR_DISEASE,
                NVL(CORONARY_ARTERY_DISEASE, 0) AS CORONARY_ARTERY_DISEASE,
                NVL(OSTEOARTHRITIS, 0) AS OSTEOARTHRITIS,
                NVL(INFLAMMATORY_BOWEL_DISEASE, 0) AS INFLAMMATORY_BOWEL_DISEASE,
                NVL(HYPERTENSION, 0) AS HYPERTENSION,
                NVL(LIVER_DISEASE_ALL, 0) AS LIVER_DISEASE_ALL,
                NVL(IMMUNODEFICIENCY_DISORDERS, 0) AS IMMUNODEFICIENCY_DISORDERS,
                NVL(HEART_FAILURE, 0) AS HEART_FAILURE,
                NVL(ASTHMA, 0) AS ASTHMA,
                NVL(DEPRESSION, 0) AS DEPRESSION,
                NVL(PSYCHOSIS_AFFECTIVE, 0) AS PSYCHOSIS_AFFECTIVE,
                NVL(CKD3TO5_ESRD_DIALYSIS, 0) AS CKD3TO5_ESRD_DIALYSIS,
                NVL(COPD, 0) AS COPD,
                NVL(EATING_DISORDERS, 0) AS EATING_DISORDERS,
                NVL(HYPERLIPIDEMIA, 0) AS HYPERLIPIDEMIA,
                NVL(ATRIAL_FIBRILLATION, 0) AS ATRIAL_FIBRILLATION,
                NVL(OBESITY_MORBID, 0) AS OBESITY_MORBID,
                NVL(CHRONIC_PAIN, 0) AS CHRONIC_PAIN
            INTO #FINAL_tmp
            FROM
                (SELECT enrolid, condition, flag FROM ANY_RULE)
                    PIVOT (SUM(flag) FOR
                        condition IN ('MALIGNANT_NEOPLASM', 'BLOOD_DYSCRASIAS', 'DIABETES_MELLITUS', 'SUBSTANCE_DEPENDENCE', 
                                        'RHEUMATOID_ARTHRITIS', 'PERIPHERAL_VASCULAR_DISEASE', 'CARDIOVASCULAR_DISEASE', 'CORONARY_ARTERY_DISEASE', 
                                        'OSTEOARTHRITIS', 'INFLAMMATORY_BOWEL_DISEASE', 'HYPERTENSION', 'LIVER_DISEASE_ALL', 'IMMUNODEFICIENCY_DISORDERS', 
                                        'HEART_FAILURE', 'ASTHMA', 'DEPRESSION', 'PSYCHOSIS_AFFECTIVE', 'CKD3TO5_ESRD_DIALYSIS', 'COPD', 
                                        'EATING_DISORDERS', 'HYPERLIPIDEMIA', 'ATRIAL_FIBRILLATION', 'OBESITY_MORBID', 'CHRONIC_PAIN')
                    );
        """
        return q
    
    #final conditions query 
    def query_conditions(self, svc_year='2024'):
        
        q = f"""

            WITH unfiltered AS (SELECT
                                    member_id,
                                    MAX(MALIGNANT_NEOPLASM) AS MALIGNANT_NEOPLASM,
                                    MAX(BLOOD_DYSCRASIAS) AS BLOOD_DYSCRASIAS,
                                    MAX(DIABETES_MELLITUS) AS DIABETES_MELLITUS,
                                    MAX(SUBSTANCE_DEPENDENCE) AS SUBSTANCE_DEPENDENCE,
                                    MAX(RHEUMATOID_ARTHRITIS) AS RHEUMATOID_ARTHRITIS,
                                    MAX(PERIPHERAL_VASCULAR_DISEASE) AS PERIPHERAL_VASCULAR_DISEASE,
                                    MAX(CARDIOVASCULAR_DISEASE) AS CARDIOVASCULAR_DISEASE,
                                    MAX(CORONARY_ARTERY_DISEASE) AS CORONARY_ARTERY_DISEASE,
                                    MAX(OSTEOARTHRITIS) AS OSTEOARTHRITIS,
                                    MAX(INFLAMMATORY_BOWEL_DISEASE) AS INFLAMMATORY_BOWEL_DISEASE,
                                    MAX(HYPERTENSION) AS HYPERTENSION,
                                    MAX(LIVER_DISEASE_ALL) AS LIVER_DISEASE_ALL,
                                    MAX(IMMUNODEFICIENCY_DISORDERS) AS IMMUNODEFICIENCY_DISORDERS,
                                    MAX(HEART_FAILURE) AS HEART_FAILURE,
                                    MAX(ASTHMA) AS ASTHMA,
                                    MAX(DEPRESSION) AS DEPRESSION,
                                    MAX(PSYCHOSIS_AFFECTIVE) AS PSYCHOSIS_AFFECTIVE,
                                    MAX(CKD3TO5_ESRD_DIALYSIS) AS CKD3TO5_ESRD_DIALYSIS,
                                    MAX(COPD) AS COPD,
                                    MAX(EATING_DISORDERS) AS EATING_DISORDERS,
                                    MAX(HYPERLIPIDEMIA) AS HYPERLIPIDEMIA,
                                    MAX(ATRIAL_FIBRILLATION) AS ATRIAL_FIBRILLATION,
                                    MAX(OBESITY_MORBID) AS OBESITY_MORBID,
                                    MAX(CHRONIC_PAIN) AS CHRONIC_PAIN
                                FROM #FINAL_tmp
                                GROUP BY member_id)
            SELECT *
            FROM unfiltered
            WHERE MALIGNANT_NEOPLASM + BLOOD_DYSCRASIAS + DIABETES_MELLITUS + SUBSTANCE_DEPENDENCE + RHEUMATOID_ARTHRITIS + PERIPHERAL_VASCULAR_DISEASE + 
                CARDIOVASCULAR_DISEASE + CORONARY_ARTERY_DISEASE + OSTEOARTHRITIS + INFLAMMATORY_BOWEL_DISEASE + HYPERTENSION + LIVER_DISEASE_ALL + IMMUNODEFICIENCY_DISORDERS + 
                HEART_FAILURE + ASTHMA + DEPRESSION + PSYCHOSIS_AFFECTIVE + CKD3TO5_ESRD_DIALYSIS + COPD + EATING_DISORDERS + HYPERLIPIDEMIA + ATRIAL_FIBRILLATION + 
                OBESITY_MORBID + CHRONIC_PAIN > 0
            ORDER BY member_id
            ;
        """
        return q